import React from "react";
import { BaseElemetPropsType } from "./BaseElemetPropsType";

type btnPropsType = BaseElemetPropsType & { onClick?: React.FormEventHandler<HTMLButtonElement> };

function Button(props: btnPropsType) {
	return <button {...props}>{props.title}</button>;
}

export default Button;
